  false,\n\t\"url\": null,\n\t\"notes\": \"The objectives of this fishing plan are
  1) To provide recreational fishing, in the Carmans River where it will not interfere
  with the purposes for which the refuge has been established. Fishing has long been
  traditional activity on Long Island and on the Carmans River. 2) To allow harvest
  of a renewable natural resource. 3) To provide for the development of an anadromous
  brown trout fishery. It also presents recommendations for program management.\",\n\t\"owner_org\":
